import React, { Component } from 'react';
import {
  Navbar,
  Nav, Button, NavItem, ButtonGroup, Container, Row, Col } from 'react-bootstrap';
  import { Spring } from  'react-spring/renderprops';
  import Slider from "react-slick";
import sliderImg from './backgroundimg/01.jpg';
import sliderImg2 from './homeimg/2.png';
import sliderImg3 from './homeimg/3.png';
import sliderImg4 from './homeimg/4.png';
import sliderImg5 from './homeimg/5.png';
import sliderImg6 from './homeimg/6.png';
import logo from './img/sch.png';
import backImg from './backgroundimg/05.jpg';

// Add CDN to HTML For Slider
//<link rel="stylesheet" type="text/css" charset="UTF-8" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick.min.css" />
/* <link rel="stylesheet" type="text/css" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick-theme.min.css" /> */
class App extends Component {

  render() {
    //js
    var settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1
    };



  // Styles
  const logoHead = {
    background:'#343a40',
    padding:'15px 10px 20px 20px',
  }
  const logoWord = {
    fontSize:'40px',
    marginLeft:'50px',
    color:'white',
    paddingBottom:'10px',
    paddingTop:'5px'
  }

  const body = {
    background: '#343a40'
    // backgroundImage: `url(${backImg})`,
    // backgroundRepeat: 'no-repeat',
    // backgroundSize: '1700px auto'
  }

const imgDem = {
  width:'100%',
  height:'auto',
  position:'relative'
}
const buttonStyle = {
  textAlign:'center',
  position:'relative',
  bottom:'400px',
  left:'500px',

}

const counter = {
  borderRadius:'50%',
  background:'black',
  fontSize:'30px',
  color:'white'
}
const logoStyle = {
  width:'200px',
  height:'auto',
  position:'relative',
  bottom:'600px',
  left:'500px'

}

const ride = {
  textAlign:'center',
  position:'relative',
  bottom:'600px',
  marginRight:'17px',
}
const h1Edit = {
  fontSize:'60px',
  textAlign:'center',
  position:'relative',
  bottom:'705px',
}
    return (
<div style={body}>

<Spring
from={{ opacity: 0, marginLeft:-500}}
to={{opacity: 1, marginLeft:0 }}
config={{ delay: 100, duration:1000 }}

>

{ props => (
  <div style={props}>
{/* Insert below */}





  </div>
) }

</Spring>




<Spring
from={{ opacity: 0, marginTop:-500}}
to={{opacity: 1, marginTop:0 }}
config={{ delay: 100, duration:1000 }}

>

{ props => (
  <div style={props}>
{/* Insert below */}
<Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
  <Navbar.Brand href="#home">Logo Here</Navbar.Brand>
  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="#"></Nav.Link>
      <Nav.Link href="#"></Nav.Link>

    </Nav>
    <Nav>
      <Nav.Link href="#">Main</Nav.Link>
      <Nav.Link eventKey={2} href="#">
        Khanban
      </Nav.Link>
      <Nav.Link href="#">Product</Nav.Link>
      <Nav.Link eventKey={2} href="#">
        Pricing
      </Nav.Link>
      <Nav.Link href="#">Login</Nav.Link>
      <Nav.Item>
      <ButtonGroup className="mr-2" aria-label="First group">
    <Button>Sign up</Button>
  </ButtonGroup>
  </Nav.Item>
    </Nav>
  </Navbar.Collapse>
</Navbar>




  </div>
) }

</Spring>


<br/>


<Spring
from={{ opacity: 0}}
to={{opacity: 1}}
config={{ delay: 2100, duration:2100 }}

>

{ props => (
  <div style={props}>
{/* Insert below */}


<Slider {...settings}>
        <div>
          <img src={sliderImg} style={imgDem} />

          <Spring
        from={{ opacity: 0, marginLeft:-500}}
        to={{opacity: 1, marginLeft:0 }}
        config={{ delay: 2000, duration:1000 }}
        >
        { props => (
          <div style={props}>
        {/* Insert below */}
        <div>
        <Container>
          <Row>
            <Col>
             <h1 style={h1Edit}>Welcome to</h1>
            </Col>
          </Row>
        </Container>
          </div>

          </div>
        ) }
          </Spring>




          <Spring
        from={{ opacity: 0}}
        to={{opacity: 1 }}
        config={{ delay: 4000, duration:1000 }}
        >
        { props => (
          <div style={props}>
        {/* Insert below */}
        <div>
        <img src={logo} style={logoStyle} />
          </div>

          </div>
        ) }
          </Spring>


          <Spring
        from={{ opacity: 0, marginRight:-500}}
        to={{opacity: 1, marginRight:0 }}
        config={{ delay: 5000, duration:1000 }}
        >
        { props => (
          <div style={props}>
        {/* Insert below */}
        <div>
             <h1 style={ride}>Riding For Research</h1>
          </div>

          </div>
        ) }
          </Spring>





          <Spring
        from={{ opacity: 0}}
        to={{opacity: 1}}
        config={{ delay: 5500, duration:1000 }}
        >
        { props => (
          <div style={props}>
        {/* Insert below */}

             <Button variant="primary" style={buttonStyle}>Learn More</Button>


          </div>
        ) }
          </Spring>







        </div>
        <div>

          <img src={sliderImg2} style={imgDem} />
          <div style={buttonStyle}>


          </div>
        </div>
        <div>

          <img src={sliderImg3} style={imgDem}/>
          <div style={buttonStyle}>
             <Button variant="info">Location</Button>
             <br/>
          </div>
        </div>
        <div>

          <img src={sliderImg4} style={imgDem} />
          <div style={buttonStyle}>
             <Button variant="warning">Fitness</Button>
             <br/>
          </div>
        </div>
        <div>

          <img src={sliderImg5} style={imgDem} />
          <div style={buttonStyle}>
             <Button variant="success">Diet</Button>
             <br/>
          </div>
        </div>
        <div>

          <img src={sliderImg6} style={imgDem} />
          <div style={buttonStyle}>
             <Button variant="warning">Media</Button>
             <br/>
          </div>
        </div>
      </Slider>
  </div>
) }

</Spring>


      </div>
    )
  }
}


export default App
